import React, { Component } from "react";
import { Card, Grid, CardContent, Typography } from '@material-ui/core';

const Display = (props) => {
  return (
      <div>
      {props.map(item =>
          <Card >
            <CardContent>
              <Typography>{item.name}</Typography>
            </CardContent>
          </Card>
        )}
      </div>
  );
}

export default class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
    };
  }


  componentDidMount() {
    this.getKitchen();
  }

  render() {
    return(
      <div>
        <Display data={this.state.items}/>
      </div>
    );
  }
}
